import React from 'react'
import Button from '@mui/material/Button';

import { BrowserRouter, Routes, Route } from '..?';



function home() {

  
  return (
    <div>
{/* Header */}

    <header>

    <h1>Cadastro De Clientes</h1>

    <br />
    <br />
    </header>

{/* Main */}

    <main>

    <h2>Cadastrar Intrumento Musical: </h2>
    <br />
    <Button variant="contained" color="success" onClick={handleCadastrarInstrumento}>Cadastrar Instrumento</Button>

    <br />
    <br />

    <h2>Cadastrar Cliente: </h2>
    <Button variant="contained" color="success">Cadastrar Instrumento</Button>

    </main>


    </div>
  )
}

export default home
